class Product extends Component {
    
    render() {
        const {title,image,price}=this.props.product;
        console.log(title)
        return (
            <div className="img-thumbnail row">
   
            <img src={image} alt='images' className=''/>
            <div className=""><strong>{title}</strong></div>
          <strong className='mx-15'>`${price}`</strong>

            
            </div>
        );
    }
}

export default Product;
